import React, { useState } from 'react'
import Delete from '../del/Delete';

const DEmployee =()=>{

    const [waiter, setWaiter] = useState(false)
    const [chef, setChef] = useState(false)


    return(
        <div>
        <hr />
            <h1>Delete for The Registered Employees</h1>
        <hr />
            <div className='inf'>
                <button className={'btn btn-outline-' + (waiter ? 'danger': 'dark')} onClick={()=>{setWaiter(!waiter)}}>
                {(waiter ? 'Hide Delete Column: Waiters': 'Delete For Registered Waiters')}
                </button>
                <hr />
               {waiter && <Delete table={'WAITER'} ></Delete> }
            </div>
            <div className='aa'>
            <button className={'btn btn-outline-' + (chef ? 'danger': 'dark')} onClick={()=>{setChef(!chef)}} >
                {(chef ? 'Hide Delete Column: Chefs': 'Delete For Registered Chefs')}
            </button>
                <hr />
                {chef && <Delete table={'CHEF'} ></Delete> }
            </div>
        </div>
    )
}

export default DEmployee;
